import React from "react";

function MainCard(props) {

    const img = `../../images/icon-${props.mediaName}.svg`;
    return (<div class="card big fb">
        <img src={img} />{props.id}
        <h1>{props.followers}</h1>
        <span class="unit">Followers</span>
        <div><img src="images/icon-up.svg" />12 Today</div>
    </div>);
}

export default MainCard;
